import React, { Component } from 'react';
import './scss/App.scss';

export class Slide4 extends Component {
  render(){
return(
      <div className="slide4"> 
      <h1 className="headline">YOUR STATS PER GAME</h1>
      <h2>DEFENCE:</h2>
      <div><span>BLOCKS</span><input type="range" min="0" max="50" step="1"><datalist id="tickmarks">
  <option value="0" label="0%"/>>
  <option value="10"/>>
  <option value="20"/>>
  <option value="30"/>>
  <option value="40"/>>
  <option value="50" label="50%"/>>
  <option value="60"/>>
  <option value="70"/>>
  <option value="80"/>>
  <option value="90"/>>
  <option value="100" label="100%"/>></datalist></input></div>
      <div><span>STEALS</span><input type="range"></input></div>
     <div><span>REBOUNS</span><input type="range"></input></div> 

</div>
    )
  }
}

export default Slide4;
